import "./Picker.css";
import ButtonBack from '../buttons/ButtonBack'




class Picker extends Component {



  render() {
    var visibility = "hide";
    if (this.props.feladatokVisibility) {
      visibility = "show";
    }

    return (
      <div>
        <div id="picker" className={visibility}>
        </div>
        PICKER
        </div>
    );
  }

}

export default Picker;
